import { Component } from 'react'

function Square(props) {
  return (
    <button className='square' onClick={()=>{alert(props.value)}} >{props.value}</button>
  )
}

class Board extends Component {
  render() {
    let squareArr = [[0,1,2],[3,4,5],[6,7,8]]
    return (
      <div className='board'>
        <div>Next Player:X</div>
        {
          squareArr.map((item,index)=>{
            return (
              <div key={index+'border'}>
                {
                  item.map((ele,idx)=>{
                    return (
                      <Square value={ele} key={idx+'square'}></Square>
                    )
                  })
                }
              </div>
            )
          })
        }
      </div>
    )
  }
}

class Game extends Component {
  render() {
    return (
      <div className={'game'}>
        <Board></Board>
        <div className="gameInfo">
          <ol>
            <li>step:1</li>
            <li>step:2</li>
            <li>step:3</li>
          </ol>
        </div>
      </div>
    )
  }
}

class Index extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <Game></Game>
    )
  }
}

export default Index
